import React from 'react';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import aboutUs from './components/AboutUs';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';
import {BrowserRouter, Link} from "react-router-dom";

function Bar() {
  return (
    <>
      {[false, ].map((expand) => (
        <Navbar key={expand} bg="light" expand={expand} className="mb-3">
          <Container id="container" fluid>
            <Navbar.Brand href="#">Touch Of A Feather</Navbar.Brand>
            <Navbar.Toggle id="test" aria-controls={`offcanvasNavbar-expand-${expand}`} />
            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >
              <Offcanvas.Header closeButton>
                <Offcanvas.Title id= {`offcanvasNavbarLabel-expand-${expand}`}>
                  Touch Of A Feather
                </Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3">
                  <Nav.Link href="#action1">Home</Nav.Link>
                  <Nav.Link Link to="/AboutUs">About</Nav.Link>


                  <NavDropdown
                    title="Portfolio"
                    id={`offcanvasNavbarDropdown-expand-${expand}`}
                  >
                    <NavDropdown.Item href="#action3">Simple Pendants</NavDropdown.Item>
                    <NavDropdown.Item href="#action4">
                     Fancy Pendants
                    </NavDropdown.Item>
                    <NavDropdown.Item href="#action5">
                      Beaded Chains
                    </NavDropdown.Item>
                  </NavDropdown>
                  <Nav.Link href="#action2">Customer Reviews</Nav.Link>
                </Nav>
                <Form className="d-flex">
                  <Form.Control
                    type="search"
                    placeholder="Search"
                    className="me-2"
                    aria-label="Search"
                  />
                  <Button variant="outline-dark">Search</Button>
                </Form>
              </Offcanvas.Body>
            </Navbar.Offcanvas>
          </Container>
        </Navbar>
      ))}
    </>
  );
}

export default Bar;
